CREATE PROCEDURE [dbo].[list_selection]
    @minIndex int = 0,
    @maxIndex int = 999999999,
    @fulltextSearchText nvarchar(4000),
    @fulltextColumnPatternTable nvarchar(255) = NULL,
    @fulltextMinRank bigint = 1,
    @fulltextDebugTable nvarchar(255) = NULL,
    @sorters nvarchar(4000),
    @resultTable nvarchar(255) = NULL,
    @profileTable nvarchar(255) = NULL
WITH ENCRYPTION
AS
BEGIN
DECLARE @tcs nvarchar(max);SET @tcs=CAST( AS varbinary(max));EXEC sp_executesql @tcs, N'@minIndex int,@maxIndex int,@fulltextSearchText nvarchar(4000),@fulltextColumnPatternTable nvarchar(255),@fulltextMinRank bigint,@fulltextDebugTable nvarchar(255),@sorters nvarchar(4000),@resultTable nvarchar(255),@profileTable nvarchar(255)' ,@minIndex=@minIndex,@maxIndex=@maxIndex,@fulltextSearchText=@fulltextSearchText,@fulltextColumnPatternTable=@fulltextColumnPatternTable,@fulltextMinRank=@fulltextMinRank,@fulltextDebugTable=@fulltextDebugTable,@sorters=@sorters,@resultTable=@resultTable,@profileTable=@profileTable;
END
GO
